import React from "react";

export default function Signup() {
  return (
    <div className='sign-up'>
      <form>
        <label>First name:</label>
        <br />
        <input type='text' />
        <br />
        <label>Last name:</label>
        <br />
        <input type='text' />
      </form>
      <button>Sign up</button>
    </div>
  );
}
